from sympy import divisors
from sympy.core.cache import cacheit
def a002129(n): return -sum((-1)**d*d for d in divisors(n))
@cacheit
def a(n): return 1 if n==0 else 48*sum(a002129(k)*a(n - k) for k in range(1, n + 1))//n
